import React from 'react';

const NextPage = () => {
  return (
    <div>
      <h1>More Resources</h1>
      <h2>NHS Website:</h2>

           You can learn more about menopause on{' '}
          <a href="https://www.nhs.uk/conditions/menopause/" target="_blank" rel="noopener noreferrer">
          NHS - Menopause
          </a>


      <h2>Podcast:</h2> If you would like to learn more about the menopause, we highly recommend listening to this podcast. There are many creators making excellent content about the menopause and how it affects women all around the world. 

<p><iframe style={{border:"1%"}}  src="https://open.spotify.com/embed/show/7dCctfyI9bODGDaFnjfKhg?utm_source=generator" width="100%" height="352" frameBorder="0" allowfullscreen="" allow="autoplay; clipboard-write; encrypted-media; fullscreen; picture-in-picture" loading="lazy"></iframe>
</p>
<div>
<h2>The Menopause Charity:</h2>

   You can read first hand accounts of fantastic women who went through menopause at different stages of their life: how they recognised the symtoms, how they adapted to the new phase of their life {' '}
  <a href="https://www.themenopausecharity.org" target="_blank" rel="noopener noreferrer">
 Menopause Charity
  </a>

<h3>Read Emily's story:</h3>
  <h3> "With a family history of Premature Ovarian Insufficiency (POI), I was always concerned about having an early menopause." </h3>
  <a href="https://www.themenopausecharity.org/2023/03/08/emilys-story/" target="_blank" rel="noopener noreferrer">
 Emily's Story
  </a>
  </div>
    </div>
  );
};

export default NextPage;
